    <style>


        #icons {
            direction: ltr;
            padding:20px;
        }

        .fontawesome-icon-list > div {
            height: 20px;
        }

        .fontawesome-icon-list a {
            color: #666;
            display: block;
            overflow: hidden;
            text-overflow: ellipsis;
            white-space: nowrap;
        }

        .fontawesome-icon-list a:hover,
        .fontawesome-icon-list a:focus {
            overflow: visible;
            z-index: 1;
            position: relative;
            padding-left: 4px;
            font-weight: bold;
            display: flex;
        }

        .fontawesome-icon-list a .fa {
            color: #ff5722;
        }

        .fontawesome-icon-list a:hover .fa,.fontawesome-icon-list a:focus .fa {
            font-size: 40px;
            color: #F44336;
            background: rgba(255, 255, 255, 0.75);
            padding: 5px 3px 5px 0px;
            display: inline-block;
            border-radius: 10px;
            margin: -13px 0px 0px -10px;
        }
        a:hover, a:focus {
            text-decoration: none;
            outline: none;
        }
    </style>
    <script>
        $(function () {
            $('#icons a').click(function () {
                copyToClipboard($(this));
                //alert(copyToClipboard($(this)));
                return false;
            });
        });
        function copyToClipboard(element) {
            var $temp = $("<input>");
            $("body").append($temp);
            text=element.find('i').attr("class").split(/\s/)[1];
            $temp.val(text).select();
            document.execCommand("copy");
            $temp.remove();
            return text;
        }
    </script>
